import { Component, EventEmitter, Input, OnDestroy, OnInit, Output, OnChanges } from '@angular/core'
import { DomSanitizer, SafeUrl } from '@angular/platform-browser'
import { ActivatedRoute } from '@angular/router'
import { ConfigurationsService, NsPage, ValueService } from '@ws-widget/utils'
import { Subscription } from 'rxjs'
import { ViewerDataService } from '../../viewer-data.service'
import { WidgetContentService } from '@ws-widget/collection/src/lib/_services/widget-content.service'
import { ViewerUtilService } from '../../viewer-util.service'
import { NsContent } from '@ws-widget/collection/src/lib/_services/widget-content.model'
import { MatDialog } from '@angular/material'
import { jsPDF } from 'jspdf'
import 'jspdf-autotable'
import { BadgesService } from '../../../../../app/src/lib/routes/profile/routes/badges/badges.service'
import { IBadgeResponse } from '../../../../../app/src/lib/routes/profile/routes/badges/badges.model'
import moment from 'moment'
import { IUserProfileDetailsFromRegistry } from '../../../../../app/src/lib/routes/user-profile/models/user-profile.model'
import { NoAccessDialogComponent } from '../../../../../app/src/lib/routes/goals/components/no-access-dialog/no-access-dialog.component'
@Component({
  selector: 'viewer-viewer-top-bar',
  templateUrl: './viewer-top-bar.component.html',
  styleUrls: ['./viewer-top-bar.component.scss'],
})
export class ViewerTopBarComponent implements OnInit, OnChanges, OnDestroy {
  @Input() frameReference: any
  @Input() forPreview = false
  @Output() toggle = new EventEmitter()
  private viewerDataServiceSubscription: Subscription | null = null
  private paramSubscription: Subscription | null = null
  private viewerDataServiceResourceSubscription: Subscription | null = null
  appIcon: SafeUrl | null = null
  isTypeOfCollection = false
  collectionType: string | null = null
  prevResourceUrl: string | null = null
  nextResourceUrl: string | null = null
  pageNavbar: Partial<NsPage.INavBackground> = this.configSvc.pageNavBar
  resourceId: string = (this.viewerDataSvc.resourceId as string) || ''
  resourceName: string | null = this.viewerDataSvc.resource ? this.viewerDataSvc.resource.name : ''
  collectionId = ''
  logo = true
  isPreview = false
  forChannel = false
  collection: any
  collectionCard: any
  @Input() screenContent: NsContent.IContent | null = null
  // @Input() enableFullScreen: any
  public isInFullScreen = false
  obj: NsContent.IContent | null = null
  isAuthor = false
  @Output() fsState: EventEmitter<boolean> = new EventEmitter()
  isSmall = false
  collectionIdentifier: any
  courseStatus = ''
  isUpdating = false
  badges: IBadgeResponse
  imageUrl = '/fusion-assets/icons/certificate.jpg'
  allowDownload = false
  showDownloadCertificate = false
  userFullname = ''
  receivedDate = ''

  // tslint:disable-next-line:max-line-length
  private readonly imageContent = ''
  // tslint:disable-next-line:max-line-length
  private readonly iNCCertificate = 'data:image/jpeg;base64,'
  rnNumber = ''
  constructor(
    private activatedRoute: ActivatedRoute,
    private domSanitizer: DomSanitizer,
    // private logger: LoggerService,
    private configSvc: ConfigurationsService,
    private viewerDataSvc: ViewerDataService,
    private valueSvc: ValueService,
    private contentSvc: WidgetContentService,
    private viewerSvc: ViewerUtilService,
    public dialog: MatDialog,
    private badgesSvc: BadgesService,
  ) {
    this.badges = {
      canEarn: [],
      closeToEarning: [],
      earned: [],
      lastUpdatedDate: '',
      recent: [],
      totalPoints: [{ collaborative_points: 0, learning_points: 0 }],
    }
    this.valueSvc.isXSmall$.subscribe(isXSmall => {
      // this.logo = !isXSmall
      this.isSmall = isXSmall
    })
  }

  ngOnChanges() {
    if (this.screenContent !== null) {
      this.obj = this.screenContent
    }

  }

  ngOnInit() {
    if (window.location.href.includes('/channel/')) {
      this.forChannel = true
    }
    if (window.location.href.includes('/author/')) {
      this.isAuthor = true
    }
    this.isTypeOfCollection = this.activatedRoute.snapshot.queryParams.collectionType ? true : false
    this.collectionType = this.activatedRoute.snapshot.queryParams.collectionType
    // if (this.configSvc.rootOrg === EInstance.INSTANCE) {
    // this.logo = false
    // }

    const collectionId = this.activatedRoute.snapshot.queryParams.collectionId
    this.collectionIdentifier = collectionId
    if (this.collectionIdentifier === 'lex_auth_01308384668903833673' || this.collectionIdentifier === 'lex_auth_01311423170518220869'
      || this.collectionIdentifier === 'lex_auth_013268426750025728383') {
      this.showDownloadCertificate = true
    }
    const collectionType = this.activatedRoute.snapshot.queryParams.collectionType
    if (collectionId && collectionType) {
      // if (
      //   collectionType.toLowerCase() ===
      //   NsContent.EMiscPlayerSupportedCollectionTypes.PLAYLIST.toLowerCase()
      // )
      //  {
      // this.collection = this.getPlaylistContent(collectionId, collectionType)
      try {
        this.contentSvc
          .fetchAuthoringContent(collectionId).subscribe(data => {
            this.collection = data
            if (this.configSvc.instanceConfig) {
              this.appIcon = this.domSanitizer.bypassSecurityTrustResourceUrl(
                this.configSvc.instanceConfig.logos.appBottomNav,
              )
            }
            // tslint:disable-next-line:no-shadowed-variable
            this.viewerDataServiceSubscription = this.viewerDataSvc.tocChangeSubject.subscribe(data => {
              this.prevResourceUrl = data.prevResource
              this.nextResourceUrl = data.nextResource
              if (this.resourceId !== this.viewerDataSvc.resourceId) {
                this.resourceId = this.viewerDataSvc.resourceId as string
                this.resourceName = this.viewerDataSvc.resource ? this.viewerDataSvc.resource.name : ''
              }
            })
            this.paramSubscription = this.activatedRoute.queryParamMap.subscribe(async params => {
              this.collectionId = params.get('collectionId') as string
              this.isPreview = params.get('preview') === 'true' ? true : false
            })
            this.viewerDataServiceResourceSubscription = this.viewerDataSvc.changedSubject.subscribe(
              _data => {
                this.resourceId = this.viewerDataSvc.resourceId as string
                this.resourceName = this.viewerDataSvc.resource ? this.viewerDataSvc.resource.name : ''
              },
            )
            this.viewerSvc.castResource.subscribe(user => this.screenContent = user)
          })
      } catch (e) {
        // TODO  console.log(e)
      }
    }

    // this.viewerDataSubscription = this.viewerSvc
    // .getContent(this.activatedRoute.snapshot.paramMap.get('resourceId') || '')
    // .subscribe(data => {
    //   this.pdfData = data
    //   // if (this.pdfData) {
    //   //   this.formDiscussionForumWidget(this.pdfData)
    //   //   if (this.discussionForumWidget) {
    //   //     this.discussionForumWidget.widgetData.isDisabled = true
    //   //   }
    //   // }
    // }
    this.viewerDataSvc.progressStatus.subscribe(data => {
      this.courseStatus = data
    })
  }

  // Fetch badge data for certificate download
  fetchBadges() {
    this.badgesSvc.fetchBadges().subscribe(data => {
      this.badges = data
    })
  }

  updateBadges() {
    this.badgesSvc.reCalculateBadges().subscribe(
      _ => {
        this.fetchBadges()
      })
  }

  getReceivedDate(badgeId: string) {
    this.badges.recent.forEach(badge => {
      if (badge.badge_id === badgeId) {
        this.receivedDate = badge.last_received_date
      }
    })
    if (this.receivedDate === '') {
      this.badges.earned.forEach(badge => {
        if (badge.badge_id === badgeId) {
          this.receivedDate = badge.last_received_date
        }
      })
    }
    return this.receivedDate
  }

  fullScreenState(state: boolean) {
    this.isInFullScreen = state
    this.fsState.emit(state)
  }

  ngOnDestroy() {
    if (this.viewerDataServiceSubscription) {
      this.viewerDataServiceSubscription.unsubscribe()
    }
    if (this.paramSubscription) {
      this.paramSubscription.unsubscribe()
    }
    if (this.viewerDataServiceResourceSubscription) {
      this.viewerDataServiceResourceSubscription.unsubscribe()
    }
  }

  toggleSideBar() {
    this.toggle.emit()
  }

  back() {
    try {
      if (window.self !== window.top) {
        return
      }
      window.history.back()
    } catch (_ex) {
      window.history.back()
    }
  }

  downloadCertificate() {
    const nqocnId = 'lex_auth_01311423170518220869'
    const fernadezId = 'lex_auth_01308384668903833673'
    const iNCCourseId = 'lex_auth_013268426750025728383'
    // Get latest batches
    this.updateBadges()
    this.configSvc.userRegistryData.subscribe((userData: IUserProfileDetailsFromRegistry) => {
      this.userFullname = `${userData.personalDetails.firstname}  ${userData.personalDetails.surname}`
      this.rnNumber = `${userData.personalDetails.regNurseRegMidwifeNumber} || 'Public Health Professional'`
    })
    if (this.courseStatus === 'completed') {
      // this.badgesSvc.fetchRecentBadge()
      if (this.collection.identifier.includes(fernadezId) || this.collection.identifier.includes(iNCCourseId)) {
        this.downloadPdf(this.collection.identifier)
      } else
        if (this.collection.identifier.includes(nqocnId)) {
          this.getReceivedDate(nqocnId)
          if (this.receivedDate) {
            this.allowDownload = moment(this.receivedDate).isSameOrAfter('2021-03-08')
          }
          if (this.allowDownload) {
            this.downloadPdf(nqocnId)
          }
        }
    }
  }

  getBase64Image(img: any) {
    const canvas = document.createElement('canvas')
    const ctx = canvas.getContext('2d')
    if (img) {
      canvas.width = img.width
      canvas.height = img.height
      if (ctx) {
        ctx.drawImage(img, 0, 0)
      }
    }
    const dataURL = canvas.toDataURL('image/jpeg')
    return dataURL
  }

  downloadPdf(badgeId: string) {
    let imageData = ''
    // Fernandes course
    if (badgeId.includes('lex_auth_01308384668903833673')) {
      const receivedDate = this.getReceivedDate(badgeId)
      const doc = new jsPDF('landscape', 'mm', [297, 210])
      const width = doc.internal.pageSize.getWidth()
      const height = doc.internal.pageSize.getHeight()
      imageData = this.getBase64Image(document.getElementById('imageUrl'))
      doc.addImage(imageData, 'JPG', 0, 0, width, height)

      doc.setFontSize(20)
      doc.setTextColor(100);

      (doc as any).autoTable({
        body: [
          [{
            // tslint:disable-next-line:max-line-length
            content: `${this.collection.name} \n by ${`${this.titleCaseWord(this.userFullname)}`}
            Completed on ${receivedDate}`,
            colSpan: 2,
            rowSpan: 2,
            styles: { halign: 'center', valign: 'middle' },
          }],
        ],
        theme: 'plain',
        columnStyles: { 0: { halign: 'center', font: 'times', fontSize: 24, minCellHeight: 50 } },
        margin: { top: 80 },

      })
      doc.save('certificate_fernandez.pdf')
    } else
      if (badgeId.includes('lex_auth_013268426750025728383')) { // INC Course
        let dataImage = ''
        const req = {
          course: badgeId,
        }
        let responseQRCode = ''
        this.badgesSvc.generateQRCode(req).subscribe(data => {
          responseQRCode = data.data

          if (data) {
            dataImage = this.iNCCertificate
            this.receivedDate = this.getReceivedDate(badgeId)
            const doc = new jsPDF('landscape', 'mm', [297, 190])
            const width = doc.internal.pageSize.getWidth()
            const height = doc.internal.pageSize.getHeight()
            if (dataImage) {
              doc.addImage(dataImage, 'JPG', 0, 0, width, height)
              doc.setFontSize(20)
              doc.setTextColor(100);

              (doc as any).autoTable({
                body: [
                  [{
                    content: ` ${`${this.titleCaseWord(this.userFullname)}`}`,
                    colSpan: 1,
                    rowSpan: 2,
                    styles: { halign: 'left' },
                  },
                  {
                    content: `${this.rnNumber}`,
                    colSpan: 1,
                    rowSpan: 2,
                    styles: { halign: 'center' },
                  }],
                ],
                theme: 'plain',
                // tslint:disable-next-line:max-line-length
                columnStyles: { 0: { halign: 'center', font: 'times', fontSize: 24, minCellHeight: 50 }, 1: { halign: 'center', font: 'times', fontSize: 22, minCellHeight: 50 } },
                margin: { top: 105, left: 100 },

              })
              doc.addImage(responseQRCode, 'png', 20, 137, 40, 40)

              doc.setFontSize(10)
              doc.text(`Download date ${moment(new Date()).format('DD/MM/YYYY')}`, 20, 186)
              doc.text(`Awarded On ${this.receivedDate}`, 150, 186)
              doc.save('certificate_inc.pdf')
            }
          }
        })

      } else {
        const req = {
          course: badgeId,
        }
        let responseQRCode = ''
        let dataImage = ''
        this.badgesSvc.generateQRCode(req).subscribe(data => {
          responseQRCode = data.data
          if (data) {
            dataImage = this.imageContent

            const doc = new jsPDF('landscape', 'mm', [297, 190])
            const width = doc.internal.pageSize.getWidth()
            const height = doc.internal.pageSize.getHeight()

            doc.addImage(dataImage, 'JPG', 0, 0, width, height)

            doc.setFontSize(20)
            doc.setTextColor(100);

            (doc as any).autoTable({
              body: [
                [{
                  // tslint:disable-next-line:max-line-length
                  content: ` ${`${this.titleCaseWord(this.userFullname)}`}`,
                  colSpan: 2,
                  rowSpan: 2,
                  styles: { halign: 'center' },
                }],
              ],
              theme: 'plain',
              columnStyles: { 0: { halign: 'center', font: 'times', fontSize: 24, minCellHeight: 50 } },
              margin: { top: 88 },

            })
            doc.addImage(responseQRCode, 'png', 5, 140, 40, 40)
            doc.save('certificate_pocqi.pdf')
          }
        })

      }
  }

  titleCaseWord(word: any) {
    if (!word) { return word }
    return word[0].toUpperCase() + word.substr(1).toLowerCase()
  }

  showCompleteCourseDialog() {
    this.dialog.open(NoAccessDialogComponent, {
      data: {
        type: 'certify',
      },
      width: '600px',
    })
  }
}
